import React from 'react';

import ListMovies from '../components/ListMovies'
import FormMovies from '../components/FormMovies'

const Movies = () => {
  return <>
        <div>
            <FormMovies />
            <ListMovies />
        </div>
  </>;
};

export default Movies;
